import React from "react";
import styles from './Profile.module.css'
import MyPosts from "./MyPosts/MyPosts";
import ProfileInfo from "./ProfileInfo/ProfileInfo";


function Profile() {

    let posts = [
        {id: 1, message: "Hey, hello, how are you", likes: 10},
        {id: 2, message: "hello, i am good, and you", likes: 10},
        {id: 3, message: "I am good too, thanks", likes: 10},
        {id: 4, message: "This is great", likes: 10},
    ]

    return (
        <div className={styles.profile}>
            <ProfileInfo
                bg_img={'https://catherineasquithgallery.com/uploads/posts/2021-03/1614855297_173-p-foni-na-yutub-206.jpg'}
                avatar_img={'https://avatars.mds.yandex.net/i?id=122cd3b9add9207fe88f104c1534e7a5e88a97c1-5305509-images-thumbs&n=13&exp=1'}
            />
            <MyPosts posts={posts}/>
        </div>
    )
}

export default Profile
